import React from "react";
import { AppBar, Toolbar, styled } from "@mui/material";

const Header = styled(AppBar)`
  background: #111111;
`;

const Navbar = () => {
  return (
    <Header>
      <Toolbar>
        <p> InfoObjects</p>
        <p>All Users</p>
        <p>Add User</p>
      </Toolbar>
    </Header>
  );
};

export default Navbar;
